/*
@cyan:         #35a766;
@blue:         #5977d3;
@purple:       #8100c6;
@green:        #8fad06;
@red:          #d24d4d;
@orange:       #cd8e21;
@light-orange: #e3a92d;
*/
.github-BranchMenuView-selector {
  display: flex;
  align-items: center;
}
.github-BranchMenuView-item {
  margin: 5px;
}
.github-BranchMenuView .icon-git-branch {
  flex-basis: 16px;
  flex-grow: 0;
  flex-shrink: 0;
  color: #868e96;
}
.github-BranchMenuView .icon-git-branch::before {
  margin-right: 0;
  text-align: center;
}
.github-BranchMenuView-select {
  flex-grow: 1;
  flex-shrink: 1;
  width: 100%;
}
.github-BranchMenuView-button {
  flex-grow: 0;
  flex-shrink: 0;
}
.github-BranchMenuView-editor {
  flex: 1;
}
.github-BranchMenuView-editor atom-text-editor,
.github-BranchMenuView-editor atom-text-editor .cursor-line {
  background-color: inherit;
}
.github-BranchMenuView-editor atom-text-editor[mini] {
  font-size: inherit;
  text-align: left;
}
.github-BranchMenuView-message {
  max-height: 20em;
  margin: 5px;
  padding: 5px;
  line-height: 1.4;
  white-space: normal;
  text-align: left;
  overflow-y: auto;
  border: 1px solid #f1f3f5;
  border-radius: 2px;
  background-color: #fff;
}
.github-BranchMenuView-message:empty {
  display: none;
}
